import { Provider } from "react-redux";
import store from "./store";
import HeaderComponent from "./compenents/header";

function App() {
  return (
    <Provider store={store}>
      <div className="table w-full h-full table-fixed bg-gray-100">
        <HeaderComponent />
      </div>
    </Provider>
  );
}

export default App;
